import React from 'react';

const Gather = (props) => { // N개의 독서 모임
  return (
    <>
      <h1>N개의 독서 모임</h1>
      <h2>모집중</h2>
      <h3>최신순</h3>
      <br></br>
    </>
  )
};

export default Gather;
